function maxYofData(data) {
    // this.maxYofData([[{x: 1, y:1}]])
    // this.maxYofData([[{x: 1, y:1}, {x: 2, y:2}],[{x: 1, y:2},{x: 2, y:3}]])
    // this.maxYofData(this.data)
    // data = this.data

    if (!data) return undefined;

    var xlength = data[0].length
    var ylength = data.length
    var sums = []
    // when the data collections are layed out weired I have to do it manually..
    for(var i=0; i < xlength; i++) {
        var s = 0;
        for(var j=0; j < ylength; j++) {
            s += data[j][i].y
        };
        sums.push(s)
    }
    return pv.max(sums)
}

